import React, { Component } from "react";
import Header from "../Header/Header";
import { Route, Switch } from "react-router-dom";
import Home from "../../ContentComponents/Home";
import Artists from "../../ContentComponents/Artists";
import Genres from "../../ContentComponents/Genres";
import Station from "../../ContentComponents/Station";
import Music from "../../ContentComponents/Music";
import "./Content.scss";
import Footer from "../Footer/Footer";
import Audio from "../../WrapperComponents/Audio/Audio";
import HomePage from "../../../Authentication/HomePage";
import PrivateRoute from "../../PrivateRoute/PrivateRoute";
import SetAuthToken from "./Utils/SetAuthToken";
import jwt_decode from "jwt-decode";
import store from "./Store/Store";
import { setCurrentUser } from "./Actions";

class Content extends Component {
  render() {
    let auth_token = localStorage.getItem("jwtToken");
    if (auth_token) {
      SetAuthToken(auth_token);
      const decoded = jwt_decode(auth_token);
      store.dispatch(setCurrentUser(decoded));
      console.log("11111", decoded);
      const currentTime = Date.now() / 1000;
      if (decoded.exp < currentTime) {
        store.dispatch(logoutUser());
        window.location.href = "./home-page";
      }
    }
    return (
      <div>
        <div className="banner bg-home"></div>
        <div className="main-container">
          <Switch>
            <PrivateRoute exact path="/home" component={Home} />
            <PrivateRoute path="/artists" component={Artists} />
            <PrivateRoute path="/genres" component={Genres} />
            <PrivateRoute path="/stations" component={Station} />
            <PrivateRoute path="/music" component={Music} />
          </Switch>
        </div>
        <Footer />
        {/* <Audio fullWidth={this.props.fullWidth} /> */}
      </div>
    );
  }
}
export default Content;
